package bindings

import (
	"github.com/graniticio/granitic/ioc"
	"github.com/graniticio/granitic/ws/handler"
	"../endpoint"
)

func Components() *ioc.ProtoComponents {
	protoComponents := make([]*ioc.ProtoComponent, 2)

	//statusLogic
	statusLogic := new(endpoint.StatusLogic)
	statusLogicProto := ioc.CreateProtoComponent(statusLogic, "statusLogic")
	protoComponents[0] = statusLogicProto


	statusLogicProto.AddConfigPromise("ServiceName", "Service.Name")


	//statusHandler
	statusHandler := new(handler.WsHandler)
	statusHandlerProto := ioc.CreateProtoComponent(statusHandler, "statusHandler")
	protoComponents[1] = statusHandlerProto

	statusHandler.PathPattern = "^/service(-|_)status[/]?$"
	statusHandler.AllowDirectHTTPAccess = true
	statusHandler.HttpMethod = "GET"

	statusHandlerProto.AddDependency("Logic", "statusLogic")


	ser := ""
	frameworkModifiers := make(map[string]map[string]string)

	return ioc.NewProtoComponents(protoComponents, frameworkModifiers, &ser)
}
